window.bookSummaryJSON = "<p>A new enemies-to-lovers standalone.</p> <p>Byron Crowne is a charming liar and a gorgeous monster. <br> I detest him.<br> I can't resist him.<br> He’s awakened desires I didn’t know I had.<br> When he touches me, I need to fight him...and I need him to win.<br> Our one night stand bruises my skin and leaves dents in the walls, but the sheets aren't the only thing we shred that night.<br> And suddenly, the stakes are higher than ever.</p> <p>Olivia Monroe lights a fire in me that died a long time ago.<br> I’m a different man when I’m with her. I need to own her, take her, mark her as mine.<br> Everything changes when she might be pregnant and for the first time in my life...I’m powerless against this stubborn, untamable woman.<br> She’s the one in control and I have an impossible job:<br> Prove I’m worthy to be a father.</p>"; 
